import React from 'react';
import temple from '../../img/museum.png'
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';

const middleStyle = {
    fontSize: "48px",
    paddingLeft: 420,
    backgroundColor: '#d76843',
    backgroundImage: `url(${temple})`,
    backgroundRepeat: 'no-repeat',
    backgroundPosition: '350px',
    minHeight: '410px',
}

const sectionOne = {
    fontSize: "50px",
    paddingTop: "120px",
    paddingLeft: "500px",
    color: '#ffffff'
}

const sectionTwo = {
    fontSize: "20px",
    paddingLeft: "500px",
    color: '#ffffff'
}

const sectionThree = {
    fontSize: "20px",
    paddingLeft: "500px",
    color: '#ffffff'
}

const sectionFour = {
    fontSize: "20px",
    paddingLeft: "500px",
    color: '#ffffff'
}

function Section(props) {
    return (
        <div style={props.section}>{props.text}</div>
    )
}

export default function Middle() {
    return (
        <div style={middleStyle}>
            <Section section={sectionOne} text={"Features"}></Section>
            <Section section={sectionTwo} text={"Enjoy seamless museum visiting from the comfort of your own device."}></Section>
            <Section section={sectionThree} text={"Features"}></Section>
            <Section section={sectionFour} text={"Features"}></Section>
        </div>
    );
}
